test.sum.2354 <- function() assertThat(sum(c(1+3i, 4+6i, 1-3i), c("true", "false", "true"), na.rm = TRUE), throwsError())
test.sum.2355 <- function() assertThat(sum(c(1+3i, 4+6i, 1-3i), complex(0), na.rm = TRUE), identicalTo(6+6i))
test.sum.2356 <- function() assertThat(sum(c(1+3i, 4+6i, 1-3i), c(NA_complex_, NA_complex_, NA_complex_), na.rm = TRUE), identicalTo(6+6i))
test.sum.2357 <- function() assertThat(sum(c(1+3i, 4+6i, 1-3i), c(1+3i, 4+6i, 1-3i), na.rm = TRUE), identicalTo(12+12i))
test.sum.2358 <- function() assertThat(sum(structure("foo", class = "foo")), identicalTo(41))
test.sum.2359 <- function() assertThat(sum(structure(list(1L, "bar"), class = "bar")), identicalTo(45))
